import { Component, Vue, Prop } from 'vue-property-decorator';
import { State, Action } from 'vuex-class';

@Component
export default class ConditionLocate extends Vue {
  private items: any[] = [
    {key: '整套', value: 3},
    {key: '单间', value: 1},
    {key: '床位', value: 2},
    {key: '不限', value: ''},
  ];
  @Prop({default: ''}) private type!: any;
  @Prop({default: false}) private searchByType!: boolean;
  @Prop({default: {}}) private openTypePopup!: any;
  @Prop({default: {}}) private closeTypePopup!: any;
  @Prop({default: {}}) private changeType!: any;
  @Prop({default: {}}) private requestCallback!: any;
  get label(): any {
    if (this.type === '') {
      return '整租合租';
    } else {
      for (const i of this.items) {
        if (i.value === this.type) {
          return i.key;
        }
      }
    }
  }
  private toggleTypePopup(): void {
    if (this.searchByType) {
      this.closeTypePopup();
    } else {
      this.openTypePopup();
    }
  }
  private handleClick(i: any): void {
    this.changeType(i);
    this.requestCallback();
  }
}
